import React from 'react';
import styles from './banner.module.css'
import { Parallax } from 'react-parallax';
const back = "https://images.unsplash.com/photo-1492144534655-ae79c964c9d7?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=800&q=80"


document.body.style.textAlign="center";


function banner() {
    return (

        <Parallax 

        renderLayer={percentage => (
            <div
                style={{
                    position: 'absolute',
                    background: `rgba(255, 125, 0, ${percentage * 1})`,
                    left: '50%',
                    top: '50%',
                    width: percentage * 500,
                    height: percentage * 500,
                }}
            />
        )}
        bgImage={back} strength={450}

        >

            <div className={styles.bg_container}>
            <p className={styles.bg_p}> "The Mechanic, wherever you are get some help" </p>          
            </div>

        </Parallax>
    )
}

export default banner
